    //@note: on the Shyft blockchain, this is funded by the Shyft inflation.
    uint256 contractBalance;
    uint256 minimumRequiredStake;

    address owner = address(0);

    // set up the base jurisdiction. Use the upper end of the addressable jurisdiction space
