    function commitForUser(address payable _identifiedAddress,
                            bytes32 _signedDataKeccak,
                            uint8 _userDataSignatureV,
                            bytes32[2] memory _userDataSignatureRS
                            ) public returns (uint8 result) {
        bytes memory prefix = "\x19Ethereum Signed Message:\n32";
        bytes32 prefixedUserDataHash = keccak256(abi.encodePacked(prefix, _signedDataKeccak));

